import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import RecruiterDashboard from './pages/RecruiterDashboard';
import CandidateDashboard from './pages/CandidateDashboard';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <Navbar bg="dark" variant="dark" expand="lg">
        <Container>
          <Navbar.Brand>AI Job Matching System</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/recruiter">Recruiter Portal</Nav.Link>
            <Nav.Link as={Link} to="/candidate">Candidate Portal</Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      <Routes>
        <Route path="/" element={
          <Container className="mt-5 text-center">
            <h1>AI-Driven Job Matching System</h1>
            <p>Choose your portal:</p>
            <Link to="/recruiter" className="btn btn-primary me-3">Recruiter Portal</Link>
            <Link to="/candidate" className="btn btn-success">Candidate Portal</Link>
          </Container>
        } />
        <Route path="/recruiter" element={<RecruiterDashboard />} />
        <Route path="/candidate" element={<CandidateDashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
